import './App.css';
import Serp from './Serp' 
import { BrowserRouter as Router, Switch, Route, Link, useParams } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router> 
        <Switch>
          <Route path="/" component={Serp} exact/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
